import Link from "next/link";

export default function Home() {
  Home.getInitialProps = ({ porcodio }) => {
    return {
      porcodio: porcodio,
    };
  };

  return (
    <ul>
      <li>
        <Link href="/b" as="/a">
          <a>a</a>
        </Link>
        <h1>{porcodio}</h1>
      </li>
      <li>
        <Link href="/a" as="/b">
          <a>b</a>
        </Link>
      </li>
    </ul>
  );
}
